import React from 'react';
import {Button} from 'react-native'
import '../main.css';

export default function Inicio() {
    return(
        <React.Fragment>
            <div className="container">
                <h1 className="title">MATARAZZO APP</h1>
                <div>
                    <Button>LOGIN</Button>
                    <Button>CADASTRO</Button>
                </div>
            </div>
        </React.Fragment>
    );
}
